"use strict";(self.webpackChunkcode_harbor_hub=self.webpackChunkcode_harbor_hub||[]).push([[42211],{32659:e=>{e.exports=JSON.parse('{"tag":{"label":"algorithm of bubble-sort","permalink":"/docs/tags/algorithm-of-bubble-sort","allTagsPath":"/docs/tags","count":1,"items":[{"id":"dsa/arrays/arrays-bubblesort-in-dsa","title":"Arrays - Bubble Sort in DSA","description":"Bubble Sort is a simple sorting algorithm that repeatedly steps through the list, compares adjacent elements and swaps them if they are in the wrong order. The pass through the list is repeated until the list is sorted. The algorithm, which is a comparison sort, is named for the way smaller elements \'bubble\' to the top of the list. Although the algorithm is simple, it is too slow and impractical for most problems even when compared to insertion sort. It can be practical if the input is usually in sort order but may occasionally have some out-of-order elements nearly in position.","permalink":"/docs/dsa/arrays/arrays-bubblesort-in-dsa"}],"unlisted":false}}')}}]);